def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.convert(dtypes="numeric", copy=False, errors="ignore")

    agg_blocks: List[Block] = []
    new_items: List[np.ndarray] = []

    for block in data.blocks:
        locs = block.mgr_locs.as_array
        accessor = self.grouper._get_aggregator(block.values, how=how, axis=1, min_count=min_count)

        try:
            result = accessor.get_result()
        except NotImplementedError as e:
            if alt is None:
                deleted_items.append(locs)
                continue
            else:
                result = accessor.get_alternate_result(alt)
        except Exception as e:
            # Handle other exceptions
            print(f"Error: {e}")
            continue

        if result is not None:
            agg_block = make_block(result)

            new_items.append(locs)
            agg_blocks.append(agg_block)

    if not agg_blocks:
        raise DataError("No numeric types to aggregate")

    # resetting locs
    # ...

    return agg_blocks, agg_items
